import React, { useState } from "react";
import { Link } from "react-router-dom";

function Navbar() {
    const [isOpen, setIsOpen] = useState(false);

    return (
        <nav className="bg-[#faf9f8] p-4 shadow-md">
            <div className="flex justify-start items-center">
                {/* Logo and Title (Commented Out) */}
                {/* <h1 className="text-xl font-bold flex items-center gap-2">
                    <img src="/logo.png" alt="Family Planner Logo" className="h-10 w-10 object-contain" />
                    Family Planner
                </h1> */}

                {/* Collapse Menu Icon using custom image */}
                <button
                    className="p-2 rounded focus:outline-none focus:ring-2 focus:ring-gray-600"
                    onClick={() => setIsOpen(!isOpen)}
                >
                    <img src="/menu_icon.png" alt="Menu" className="h-8 w-8 object-contain" />
                </button>
            </div>

            {/* Navigation Links */}
            <ul className={`md:flex md:space-x-6 mt-4 md:mt-0 ${isOpen ? "flex flex-col" : "hidden"} md:block bg-[#faf9f8] md:bg-transparent p-4 md:p-0 rounded-lg shadow md:shadow-none`}>
                <li><Link to="/dashboard" className="block py-2 md:py-0 text-gray-700 hover:text-gray-900">Dashboard</Link></li>
                <li><Link to="/tasklist" className="block py-2 md:py-0 text-gray-700 hover:text-gray-900">Task List</Link></li>
                <li><Link to="/calendar" className="block py-2 md:py-0 text-gray-700 hover:text-gray-900">Calendar</Link></li>
                <li><Link to="/shoppinglist" className="block py-2 md:py-0 text-gray-700 hover:text-gray-900">Shopping List</Link></li>
                <li><Link to="/notes" className="block py-2 md:py-0 text-gray-700 hover:text-gray-900">Notes</Link></li>
                <li><Link to="/todolist" className="block py-2 md:py-0 text-gray-700 hover:text-gray-900">ToDo</Link></li>
            </ul>
        </nav>
    );
}

export default Navbar;
